document.addEventListener("DOMContentLoaded", function () {
	const resultsModal = document.getElementById("resultsModal");
	const openResultsBtn = document.getElementById("openResultsModal");
	const closeBtn = document.querySelector(".btn-close");
	const ballotSelect = document.getElementById("ballotSelect");
	const fetchResultsBtn = document.getElementById("fetchResultsBtn");
	const resultsDisplay = document.getElementById("resultsDisplay");
	const downloadResultsPdf = document.getElementById("downloadResultsPdf");

	if (
		!resultsModal ||
		!openResultsBtn ||
		!closeBtn ||
		!ballotSelect ||
		!fetchResultsBtn ||
		!resultsDisplay ||
		!downloadResultsPdf
	) {
		console.error("❌ Some elements are missing. Check your IDs.");
		return;
	}

	// Open modal and load ballots
	openResultsBtn.addEventListener("click", async function () {
		await loadAdminBallots();
	});

	async function loadAdminBallots() {
		ballotSelect.innerHTML = "<option value=''>Loading...</option>";
		try {
			const { ballotIds, ballotTitles } = await getMyBallots();
			ballotSelect.innerHTML = "";

			if (ballotIds.length === 0) {
				ballotSelect.innerHTML = "<option value=''>No ballots found</option>";
				return;
			}

			ballotIds.forEach((id, index) => {
				const option = document.createElement("option");
				option.value = id;
				option.textContent = ballotTitles[index];
				ballotSelect.appendChild(option);
			});
		} catch (error) {
			console.error("Error loading ballots:", error);
			ballotSelect.innerHTML =
				"<option value=''>Error loading ballots</option>";
		}
	}

	// Fetch results
	fetchResultsBtn.addEventListener("click", async function () {
		const ballotId = ballotSelect.value;
		if (!ballotId) {
			alert("Please select a ballot.");
			return;
		}

		try {
			const isClosed = await isBallotClosed(ballotId);
			if (!isClosed) {
				resultsDisplay.innerHTML = "<p>Voting is still ongoing.</p>";
				resultsDisplay.dataset.results = "";
				return;
			}

			const results = await getVotingResults(ballotId);

			// Convert BigInt voteCounts to strings for safe JSON storage
			const serializableResults = {
				positions: results.positions,
				candidates: results.candidates,
				voteCounts: results.voteCounts.map((arr) =>
					arr.map((v) => v.toString()),
				),
			};
			resultsDisplay.dataset.results = JSON.stringify(serializableResults);

			// Display results in modal
			displayResults(serializableResults);
		} catch (error) {
			console.error("Error fetching results:", error);
			resultsDisplay.innerHTML =
				"<p class='text-danger'>Error fetching results.</p>";
			resultsDisplay.dataset.results = "";
		}
	});

	function displayResults(results) {
		if (!results || results.positions.length === 0) {
			resultsDisplay.innerHTML = "<p>No results available.</p>";
			return;
		}

		let html = "<h3 style='text-align:center;'>Election Results</h3>";

		results.positions.forEach((position, index) => {
			const voteCounts = results.voteCounts[index].map((v) => BigInt(v));
			const maxVotes = voteCounts.reduce((a, b) => (a > b ? a : b), 0n);

			html += `<h4>${position}</h4><ul style="padding-left:20px;">`;
			results.candidates[index].forEach((candidate, i) => {
				const isWinner = voteCounts[i] === maxVotes;
				html += `<li style="${
					isWinner
						? "font-weight:bold; background-color:#d4edda; padding:2px 4px;"
						: ""
				}">
                            ${candidate}: ${voteCounts[i]} votes ${
															isWinner ? "- WINNER" : ""
														}
                         </li>`;
			});
			html += "</ul>";
		});

		resultsDisplay.innerHTML = html;
	}

	// Download results as PDF
	downloadResultsPdf.addEventListener("click", async () => {
		const ballotId = ballotSelect.value;
		const ballotTitle = ballotSelect.options[ballotSelect.selectedIndex].text;
		if (!ballotId) {
			alert("Please select a ballot before downloading.");
			return;
		}

		function formatDateTime(date) {
			if (!date) return "N/A";

			return new Date(date).toLocaleString(undefined, {
				year: "numeric",
				month: "long",
				day: "numeric",
				hour: "numeric",
				minute: "2-digit",
				hour12: true,
			});
		}

		// Fetch ballot metadata including voting_end
		let ballotEndDate = "";
		try {
			const response = await fetch(
				`https://blockchain-voting-backend.onrender.com/get-ballot/${ballotId}`,
			);
			if (!response.ok) throw new Error("Failed to fetch ballot details");

			const data = await response.json();
			// Use voting_end as the End Date
			ballotEndDate = data.voting_end ? formatDateTime(data.voting_end) : "N/A";
		} catch (error) {
			console.error("Error fetching ballot end date:", error);
			ballotEndDate = "N/A";
		}

		const currentDate = new Date().toLocaleDateString();
		const logoBase64 =
			"data:image/png;base64,";

		const voterTableHtml = resultsDisplay.innerHTML;

		const pdfContent = `
        <div style="font-family: Arial, sans-serif; width: 100%; text-align: center;">
            <div style="display:flex; flex-wrap:wrap; align-items:center; justify-content:center; margin-bottom:20px; gap:15px;">
                <img src="${logoBase64}" alt="School Logo" style="height:80px; width:auto; flex-shrink:0;" />
                <div style="max-width:70%; text-align:center;">
                    <h2 style="margin:0; font-size:clamp(14pt,2vw,18pt); font-weight:bold;">
                        IMMACULATE CONCEPTION - I COLLEGE OF ARTS AND TECHNOLOGY
                    </h2>
                    <p style="margin:0; font-size:clamp(10pt,1.5vw,12pt);">
                        Block-Chain Based Voting System
                    </p>
                </div>
            </div>
            <hr>
            <div style="text-align:left; margin:0 auto; max-width:90%;">
                <p style="text-align:center;"><strong>Ballot ID:</strong> ${ballotId}</p>
                <p style="text-align:center;"><strong>Ballot Title:</strong> ${ballotTitle}</p>
                <p style="text-align:center;"><strong>End Date:</strong> ${ballotEndDate}</p>
                <p style="text-align:center;"><strong>Download Date:</strong> ${currentDate}</p>
                <div style="margin-top:10px;">${voterTableHtml}</div>
            </div>
        </div>
    `;

		const opt = {
			margin: 10,
			filename: `Election_Results_${ballotTitle}_${new Date().toISOString()}.pdf`,
			image: { type: "jpeg", quality: 0.98 },
			html2canvas: { scale: 2 },
			jsPDF: { unit: "mm", format: "a4", orientation: "portrait" },
		};

		html2pdf().from(pdfContent).set(opt).save();
	});
});
